    const initialState =  storageState || {
        availableLocales: [
            'us',
            'fr'
        ],
        lastEmployeeId: 1314700,
        employees: [],
        departments: [
            'Information Technology',
            'Maintenance',
            'Human Resources',
            'Business Development'
